import {Navigate} from "react-router-dom";
import DashboardEditions__chief from "./chief/DashboardEditions__chief";
import {getRank, validUser} from "../api/handleLogin";

export function Dashboard(props) {
    async function getUserStatus(){
        const loggedIn = await validUser()
        const rank = await getRank()
        return ({
            "authenticated": loggedIn,
            "rank": rank.groups
        })
    }
    if(authentication === true){
        if(rank.includes(3)){
            return <p>{props.userStatus}</p>
        } else if(rank.includes(4)){
            return <p>{props.userStatus}</p>
        } else if(rank.includes(false)){
            return <p>{props.userStatus}</p>
        }
    } else if(authentication === false){
        return <p>{props.userStatus}</p>
    }
}
